function setup() {
	var canvas = createCanvas(750, 500);
	strokeWeight(1);
	clouds();
	bird(1);
}

function draw() {
	if (fadingBirdStep > 0 && fadingBirdStep <= 10) {
		clouds();
		
		if (fadingBirdStep < 10) {
			var percentage = 1 - fadingBirdStep / 10;
			if (fadingNightStep > 100) {
				background("rgba(0, 0, 0, " + percentage + ")");
				night(percentage);
			}
			bird(percentage);
		}
		
		fadingBirdStep++;
	}
	
	if (fadingNightStep > 0 && fadingNightStep <= 100) {
		background("rgba(0, 0, 0, " + (fadingNightStep / 1000) + ")");
		if (fadingNightStep >= 50) {
			night((fadingNightStep - 50) / 50);
		}
		bird(1);
		fadingNightStep++;
	}
	
	if (showLighthouse && lighthouseFadeValue > 0) {
		if (lighthouseFadeValue < 100) {
			lighthouse(lighthouseFadeValue / 1000);
			lighthouseFadeValue++;
		} else {
			lighthouse(1);
			lighthouseFadeValue = 0;
		}
	}
	
	if (showGirl) {
		if (swingFrame - swingStart < 2000) {
			animateGirl(Math.sin((swingFrame - swingStart) * Math.PI / 4000));
		} else {
			animateGirl(1);
		}
	}
}

function mouseClicked() {
	if (fadingBirdStep === 0 && (fadingNightStep === 0 || fadingNightStep > 100)) {
		if (mouseX > 0 && mouseX < width && mouseY > 0 && mouseY < height) {
			if (pointInPolygon([mouseX, mouseY], birdPolygon)) {
				fadingBirdStep = 1;
			} else if (fadingNightStep === 0) {
				fadingNightStep = 1;
			}
		}
	} else if (fadingBirdStep > 10) {
		if (!showLighthouse && mouseX > 75 && mouseX < 625 && mouseY > 265 && mouseY < 425) {
			showLighthouse = true;
		}
		
		if (!showGirl && mouseX > 415 && mouseX < 535 && mouseY > 0 && mouseY < 90) {
			swingStart = new Date().getTime();
			swingFrame = new Date().getTime();
			showGirl = true;
		}
	}
}

function pointInPolygon(point, vs) {
	// Source: https://github.com/substack/point-in-polygon
	
	var x = point[0], y = point[1];
	
	var inside = false;
	for (var i = 0, j = vs.length - 1; i < vs.length; j = i++) {
		var xi = vs[i][0], yi = vs[i][1];
		var xj = vs[j][0], yj = vs[j][1];
		
		var intersect = ((yi > y) != (yj > y))
		&& (x < (xj - xi) * (y - yi) / (yj - yi) + xi);
		if (intersect) inside = !inside;
	}
	
	return inside;
}

function animateGirl(size) {
	coverSky();
	girl(Math.sin((swingFrame - swingStart) / 400) / 3.25, size);
	coverCloud();
	
	swingFrame = new Date().getTime();
}

